import * as React from 'react';
import Stack from '@mui/material/Stack';
import Button from '@mui/material/Button';
import Container from '@mui/material/Container';
import Typography from '@mui/material/Typography';
import { useHistory } from 'react-router-dom';


export default function AddDrugBtn() {

  const history = useHistory();

  const handleClick = () => {
    history.push('/onlinepharmacy/addDrug');
  };
  return (
    <Container style={{ marginTop:'30px' , marginLeft:'0px', maxWidth:'sm'}}>
        <div>
         <Typography variant='h7' paragraph='true' color='textSecondary'>Add Medicine which are available, <br/> for the user to buy</Typography>
          <Stack spacing={2} direction="row">
            <Button variant="contained" onClick={handleClick} >Add Drug</Button>
          </Stack>
        </div>
    </Container>
  );
}
